import logo from './logo.svg';
import './App.css';
import React, { useState } from "react";

function App() {


  return (
      <model-viewer
          // className="model-viewer"
          src="./Earthi.glb"
          alt="A rock"
          exposure="1"
          disable-tap
          auto-rotate
          shadow-intensity="1"
          camera-controls
          touch-action="pan-y"
          disable-zoom

      >
      </model-viewer>
  );
}

export default App;
